import React from 'react';
import Slider from 'react-slick';

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import HomepageImage from '../../../Images/homepage.png'

import './Carousel.css'

function Carousel() {

  let settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (


    <Slider {...settings}>
    <div className='slider-container'>
      <h4>Homepage</h4>
      <div className='slider-container-inner'>
      <p>Homepage is my personal portfolio site. Built with React and deployed with AWS Amplify.<br></br> 
        This project demonstrates my ability to deliver a finished and polished product using the latest frameworks and techniques.</p>
      <img className='portfolio-image' src={HomepageImage}/>
    </div>
    </div>
    <div className='slider-container'>
      <h3>2</h3>
    </div>
    <div className='slider-container'>
      <h3>3</h3>
    </div>
    <div className='slider-container'>
      <h3>4</h3>
    </div>

  </Slider>



  )
}

export default Carousel;
